import React from 'react';
import {BoxProps as Props} from './Box.interface';
import {Box as B} from '../../../../Components/Box';

import cn from './Box.module.scss';

export function Box(props: Props) {
  return (
    <B className='' style={props.style}>
      {props.children}
    </B>
  );
}
